import React from 'react'
import '../index.css';
import DataTable from "react-data-table-component";

const Dashboard = () => {
        useEffect(() => {
                fetch("https://localhost:8080/emprestimos/getAtrasados")
                  .then(res => res.json())
                  .then(
                    (result) => {
                      setIsLoaded(true);
                      setItems(result);
                    },
                    // Nota: é importante lidar com errros aqui
                    // em vez de um bloco catch() para não receber
                    // exceções de erros reais nos componentes.
                    (error) => {
                      setIsLoaded(true);
                      setError(error);
                    }
                  )
              }, [])
        const columns = [
                {
                        name: 'Nome',
                        selector: row => row.title,
                },
                {
                        name: 'Data devolução',
                        selector: row => row.year,
                },
        ];

        const data = [
                {
                        id: 1,
                        title: 'Rhyan',
                        year: '1988/08/2020',
                },
                {
                        id: 2,
                        title: 'Ghostbusters',
                        year: '1988/08/2020',
                },
        ]
        return (
                <div className="sec__one">
                       <div className='container_midless'>
                        <div className='title'><h1 className='align_center'>Atrasados</h1></div>
                       <div className='paddingContainer'> </div><DataTable
                                columns={columns}
                                data={data}
                        />
                       </div>
                </div>
        )
}
export default Dashboard
